import React from "react";
import ReactDOM from "react-dom";
const img1="https://picsum.photos/700/700";
const img2="https://picsum.photos/500/700";
const img3="https://picsum.photos/700/500";
const links="";
 ReactDOM.render(
    <>
<h1 contentEditable="true">CKM Netflix list</h1> 

<p>
    list of five Best Series
    <ol>
        <li>Dark <img src={img2} alt="random images"/></li>
        <li>Extra curricular</li>
        <li>the secret of my wife <img src={img3} alt="random images"/></li>
        <li>fuddu</li>
        <li>hello ms india </li>
        <a href="">
            <img src={img1} alt="random images"/>
        </a>
    </ol>
</p>
 </>
,document.getElementById('root')
);
